import React from 'react'
import { Formik, Form } from 'formik';
import { TextField } from './TextField';

export const Login = () => {
    return (
        <Formik
        initialValues={{
            email: '',
            password: '',  
            }}
        >

            {formik => (
            <div>
            {console.log(formik)}
            <Form className="form-control-style">
                <input 
                name="email" 
                type="email" 
                placeholder="E-mail"
                className="input-box"/>

                <input
                name="password" 
                type="password" 
                placeholder="Senha"
                className="input-box"/>

                <button className="login-button"type="submit"> Entrar</button>
            </Form>
            </div>    
            )}
        </Formik>
    )
}
